INSERT INTO `campaign` VALUES ('2021-06-17 16:16:00.678763','2021-06-17 16:18:34.000000',1,'Ayudanos a recaudar fondos','Fondos para hacer una olla común para los vecinos del Agustino','monetario',NULL,NULL,'publicada','data:image/jpeg;base64,',1),('2021-06-17 16:27:21.600969','2021-06-17 16:36:07.000000',2,'Regalando sonrisas','Esta campaña tiene la finalidad de ayudar a niños de bajos recursos a tener una sonrisa radiante. Ellos son de San Juan de Lurigancho y son parte del asentamiento humano INTEGRACION SOLIDARIDAD Y PROGRESO.','serviciales',NULL,NULL,'publicada','data:image/jpeg;base64,',1),('2021-06-18 07:21:39.118932','2021-06-18 07:21:39.118932',3,'Chocolatada Navideña 2021 en SJL',NULL,'materiales',NULL,NULL,'creada','',2),('2021-06-18 07:29:10.065876','2021-06-18 07:29:10.065876',4,'Prueba 2',NULL,'monetario',NULL,NULL,'creada','',2),('2021-06-21 13:29:33.646472','2021-07-13 08:55:36.000000',5,'Campaña navideña para los niños de San Juan de Dios','La emergencia generada por la COVID-19 nos reta a demostrar, una vez más, nuestra solidaridad. ¿Cómo lo podemos hacer? Ayudando a niños, niñas y sus familias, que se encuentran en situación de pobreza extrema, de las zonas más humildes del distrito de San','materiales',NULL,NULL,'distribución','data:image/jpeg;base64,',1),('2021-06-21 14:01:40.036668','2021-06-21 14:08:29.000000',6,'Ayudanos a repartir canatas en Lurin 2021','Creemos que la mejor lección que podemos sacar de esta crisis es la empatía. Existen familias vulnerables que no están en condiciones de cubrir su necesidad básica de alimentación, pero hoy tú puedes hacer que esto cambie. Con estas canastas podrás asegur','materiales',NULL,NULL,'publicada','data:image/jpeg;base64,',3);
